import React from "react";
import { Space, Table, Tag } from 'antd';
import 'antd/dist/antd.css';

function Calendar() {

const dataSource = [
  {
    key: '1',
    date: 'Monday',
    period1: '',
    period2: '',
    period3: '',
    period4: ''
  },
];

const columns = [
    {
      title: 'Oct.24-28',
      dataIndex: 'date',
      key: 'date',
    },
    {
      title: 'Period 1',
      dataIndex: 'period1',
      key: 'period1',
    },
    {
      title: 'Period 2',
      dataIndex: 'period2',
      key: 'period2',
    },
    {
        title: 'Period 3',
        dataIndex: 'period3',
        key: 'period3',
    },
    {
        title: 'Period 4',
        dataIndex: 'period4',
        key: 'period4',
    },
  ];


  const year = new Date().getFullYear();
  return (
    <Table dataSource={dataSource} columns={columns} />
  );
}

export default Calendar;
